import React from 'react'
import {Formik, Form, Field} from 'formik'
import {authAPI} from '../../../api'
const initialValues = {
    reset_password: ''
}


export const ResetPassword = (props) => {
    const onSubmit = (body) => {
        const reset ={
            token: props.code,
            password: body.reset_password
        }
        authAPI.reset_password(reset)
    }
    return( <div>
        <h1>Resset password</h1>
        <h3>For Manufactures</h3>
        <Formik initialValues={initialValues} onSubmit={onSubmit}>
            <Form>
                <Field name="reset_password" type="password" />
                <button type="submit">
                    Reset Password
                </button>
            </Form>
        </Formik>
        <small>Don't have an account? <a href="">Sing up!</a></small>


    </div>
    )
    }
